import React from "react";
import CurdComponent from "@/components/CurdComponent";
import SelectOption from "@/components/SelectOption";
import { Input, Modal, Form, message, Switch, Tooltip, Icon } from "antd";
import styles from "./style.module.less";
import { connect } from "react-redux";

let getSearchFormFields = () => {
    return [
        {
            label: "算法名称",
            id: "algoName",
            component: <Input placeholder="请输入" />,
        },
    ];
};

class algoConfig extends React.PureComponent {
    getInsertFormFields = () => {
        return [
            {
                label: "算法名称",
                id: "AlgoName",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                    {
                        validator: checkLength(32),
                        trigger: ["change"],
                    },
                    {
                        message: "算法名称格式不正确",
                        pattern: /^[a-zA-Z-\u4e00-\u9fa5]{1,5}\(\w{1,5}\)/i,
                    },
                ],
                component: <Input placeholder="请输入名称,例:智能委托(ZC)" />,
            },
            {
                label: "算法风控组名称",
                id: "RiskGroup",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                    {
                        message: "请输入正整数",
                        pattern: /^[1-9][0-9]*$/i,
                    },
                ],
                component:
                    // <Input placeholder="请输入" onChange={this.inputChange} />
                    SelectOption(this.state.riskList, {
                        placeholder: "请选择",
                        onChange: this.inputChange,
                    }),
            },
            // {
            //     label: "算法厂商ID",
            //     id: "UuserId",
            //     initialValue: "",
            //     rules: [
            //         {
            //             required: true,
            //             message: "参数不能为空",
            //         },
            //         {
            //             message: "请输入正整数",
            //             pattern: /^\d+$/i,
            //         },
            //     ],
            //     component: <Input placeholder="请输入" />,
            // },
            {
                label: "算法厂商名称",
                id: "ProviderName",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                // component: <Input placeholder="请输入" />,
                component: SelectOption(this.state.providerList, {
                    placeholder: "请选择",
                    // onChange: this.inputChange,
                }),
            },
            {
                label: "算法类型",
                id: "AlgorithmType",
                initialValue: "1",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                component: SelectOption(dict.algorithmType, {
                    onChange: this.algorithmTypeChange,
                    placeholder: "请选择",
                    // allowClear: true,
                    style: {
                        width: 400,
                    },
                }),
            },
            {
                label: "算法类型ID",
                id: "AlgorithmTypeId",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                    // {
                    //     message: "请输入正整数",
                    //     pattern: /^\d+$/i,
                    // },
                    // {
                    //     validator: checkLength(2),
                    //     trigger: ["change", "blur"],
                    // },
                ],
                component: SelectOption(this.state.algorithmTypeList, {
                    placeholder: "请选择",
                    // allowClear: true,
                    style: {
                        width: 400,
                    },
                }),
                // component: <Input placeholder="请输入" />,
            },
            // {
            //     label: "算法类型名称",
            //     id: "AlgorithmTypeName",
            //     // initialValue: "",
            //     rules: [
            //         {
            //             required: true,
            //             message: "参数不能为空",
            //         },
            //         {
            //             validator: checkLength(16),
            //             trigger: ["change", "blur"],
            //         },
            //     ],
            //     component: <Input placeholder="请输入" />,
            // },
            {
                label: "是否显示",
                id: "algorithmShow",
                initialValue: false,
                valuePropName: "checked",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                component: <Switch size="small" />,
            },
            {
                label: "是否可用",
                id: "algorithmEnable",
                initialValue: false,
                valuePropName: "checked",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                component: <Switch size="small" />,
            },
            {
                label: "算法所需参数",
                id: "Parameter",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                    {
                        validator: checkLength(2000),
                        trigger: ["change", "blur"],
                    },
                ],
                component: <Input placeholder="请输入" />,
            },
        ];
    };
    getUpdateFormFields = () => {
        return [
            {
                label: "算法名称",
                id: "AlgoName",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                    {
                        validator: checkLength(32),
                        trigger: ["change", "blur"],
                    },
                    {
                        message: "算法名称格式不正确",
                        pattern: /^[a-zA-Z-\u4e00-\u9fa5]{1,5}\(\w{1,5}\)/i,
                    },
                ],
                component: <Input placeholder="请输入名称,例:智能委托(ZC)" />,
            },
            {
                label: "算法风控组名称",
                id: "RiskGroup",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                    {
                        message: "请输入正整数",
                        pattern: /^[1-9][0-9]*$/i,
                    },
                ],
                component:
                    // <Input placeholder="请输入" readOnly disabled />
                    // <Input placeholder="请输入" onChange={this.inputChange} />
                    SelectOption(this.state.riskList, {
                        placeholder: "请选择",
                        onChange: this.inputChange,
                    }),
            },
            // {
            //     label: "算法厂商ID",
            //     id: "UuserId",
            //     initialValue: "",
            //     rules: [
            //         {
            //             required: true,
            //             message: "参数不能为空",
            //         },
            //         {
            //             message: "请输入正整数",
            //             pattern: /^\d+$/i,
            //         },
            //     ],
            //     component: <Input placeholder="请输入" />,
            // },
            {
                label: "算法厂商名称",
                id: "ProviderName",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                // component: <Input placeholder="请输入" />,
                component: SelectOption(this.state.providerList, {
                    placeholder: "请选择",
                    // onChange: this.inputChange,
                }),
            },
            {
                label: "算法类型",
                id: "AlgorithmType",
                initialValue: "1",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                component: SelectOption(dict.algorithmType, {
                    onChange: this.algorithmTypeChange,
                    placeholder: "请选择",
                    // allowClear: true,
                    style: {
                        width: 400,
                    },
                }),
            },
            {
                label: "算法类型ID",
                id: "AlgorithmTypeId",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                    // {
                    //     message: "请输入正整数",
                    //     pattern: /^\d+$/i,
                    // },
                    // {
                    //     validator: checkLength(2),
                    //     trigger: ["change", "blur"],
                    // },
                ],
                component: SelectOption(this.state.algorithmTypeList, {
                    placeholder: "请选择",
                    // allowClear: true,
                    style: {
                        width: 400,
                    },
                }),
                // component: <Input placeholder="请输入" />,
            },
            // {
            //     label: "算法类型名称",
            //     id: "AlgorithmTypeName",
            //     // initialValue: "",
            //     rules: [
            //         {
            //             required: true,
            //             message: "参数不能为空",
            //         },
            //         {
            //             validator: checkLength(16),
            //             trigger: ["change", "blur"],
            //         },
            //     ],
            //     component: <Input placeholder="请输入" />,
            // },
            {
                label: "是否显示",
                id: "algorithmShow",
                // initialValue: "",
                valuePropName: "checked",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                component: <Switch size="small" />,
            },
            {
                label: "是否可用",
                id: "algorithmEnable",
                // initialValue: "",
                valuePropName: "checked",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                ],
                component: <Switch size="small" />,
            },
            {
                label: "算法所需参数",
                id: "Parameter",
                initialValue: "",
                rules: [
                    {
                        required: true,
                        message: "参数不能为空",
                    },
                    {
                        validator: checkLength(2000),
                        trigger: ["change", "blur"],
                    },
                ],
                component: <Input placeholder="请输入" />,
            },
        ];
    };
    columns = (params) => {
        return [
            {
                title: "算法名称",
                dataIndex: "algoName",
                key: "algoName",
                width: 160,
            },
            // {
            //     title: "算法厂商ID",
            //     dataIndex: "uuserId",
            //     key: "uuserId",
            // },
            {
                title: "算法厂商名称",
                dataIndex: "providerName",
                key: "providerName",
            },
            {
                title: "算法类型",
                dataIndex: "algorithmTypeValue",
                width: 130,
            },
            {
                title: "算法类型ID",
                dataIndex: "algorithmTypeIdValue",
            },
            // {
            //     title: "算法类型名称",
            //     dataIndex: "algorithmTypeName",
            //     width: 130,
            // },
            {
                title: "是否显示",
                dataIndex: "algorithmShow",
                key: "algorithmShow",
                render: (text, record) => (
                    <div
                        onDoubleClick={(e) => {
                            e.stopPropagation();
                        }}
                    >
                        <Switch
                            checked={record.algorithmShow == 2}
                            size="small"
                            onChange={(e) => {
                                // console.log(text, record);
                                this.onSwitchChange(e, record, 1);
                            }}
                        />
                    </div>
                ),
            },
            {
                title: "是否可用",
                dataIndex: "algorithmEnable",
                key: "algorithmEnable",
                render: (text, record) => (
                    <div
                        onDoubleClick={(e) => {
                            e.stopPropagation();
                        }}
                    >
                        <Switch
                            checked={record.algorithmEnable == 1}
                            size="small"
                            onChange={(e) => {
                                // console.log(text, record);
                                this.onSwitchChange(e, record, 2);
                            }}
                        />
                    </div>
                ),
            },
            {
                title: "算法所需参数",
                dataIndex: "parameter",
                key: "parameter",
                width: 130,
            },
            {
                title: "算法风控组名称",
                dataIndex: "riskName",
                key: "riskName",
                render: (text, record) => (
                    <div
                        onClick={(e) => {
                            this.handleUpdate(record);
                        }}
                    >
                        <Tooltip title="修改风控组">
                            {record.riskName}
                            {this.authObj.isUpdate && (
                                <Icon
                                    type="edit"
                                    style={{ color: "#1899ff" }}
                                />
                            )}
                        </Tooltip>
                    </div>
                ),
            },
            {
                title: "创建时间",
                dataIndex: "createTime",
                key: "createTime",
                width: 180,
            },
            // {
            //     title: "操作",
            //     key: "operation",
            //     fixed: "right",
            //     width: 100,
