        formData.algorithmEnable = formData.algorithmEnable == 1;
        form.setFieldsValue(formData);
    };
    handleUpdateRecord = ({ form }) => {
        // params = {
        //     UserId: "atest0000003",
        //     UserName: "test3",
        //     UserPasswd: "test_0000003",
        //     UserType: 1,
        //     // RiskGroup: 1,
        //     // AlgoGroup: 1,
        //     // AlgoProperty: "20",
